CREATE proc [dbo].[AddComment]
    @IDcomment VARCHAR(30),
	@IDPOST varchar(30),
	@CONTENT text, 
	@IDuser varchar(30)
AS
BEGIN
INSERT dbo.COMMENT
                                                            (
                                                                IDcomment,
                                                                IDPOST,
                                                                CONTENT,
                                                                TIME,
                                                                IDuser
                                                            )
                                                            VALUES
                                                            (   @IDcomment,        -- IDcomment - varchar(30)
