/****** Object:  StoredProcedure [dbo].[AddNotify]    Script Date: 12/23/2019 3:04:12 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROC [dbo].[AddNotify]
	@IDNotify varChar(30),
	@IDPost VARCHAR(30),
	@Content NTEXT,
	@IDuser VARCHAR(30),
	@TypeNotify SMALLINT
AS
	BEGIN
		INSERT dbo.NOTIFY
		(
		    IDnotify,
		    IDPost,
		    Content,
		    Time,
			TypeNotify,
			IDuserSend
		)
		VALUES
		(   @IDNotify,       -- IDnotify - varchar(30)
		    @IDPost,       -- IDPost - varchar(30)
		    @Content,      -- Content - ntext
		    GETDATE(),	-- Time - datetime
			@TypeNotify,
			@IDuser
		)

		IF (0=(
			   SELECT COUNT(*)
			   FROM dbo.PEOPLE_FOLLOW_POST
			   WHERE dbo.PEOPLE_FOLLOW_POST.IDuser = @IDuser AND dbo.PEOPLE_FOLLOW_POST.IDPost = @IDPost
			  ))
			INSERT dbo.PEOPLE_FOLLOW_POST
			(
			    IDPost,
			    IDuser
			)
			VALUES
			(   @IDPost, -- IDnotify - varchar(30)
			    @IDUser  -- IDuser - varchar(30)
			)

    END
GO
/****** Object:  StoredProcedure [dbo].[GetAllNotifyofUser]    Script Date: 12/23/2019 3:04:12 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROC [dbo].[GetAllNotifyofUser]
	@IDuser VARCHAR(30)
AS
	BEGIN
		SELECT dbo.NOTIFY.IDnotify, dbo.NOTIFY.IDPost,Nggui.NAME AS tênngườitươngtáctớipost, NgNhan.NAME AS tênchủpost, NgNhan.UIDuser AS UIDchủpost,dbo.NOTIFY.TypeNotify, dbo.NOTIFY.Time
		FROM dbo.NOTIFY, dbo.PROFILE AS Nggui, dbo.POST, dbo.PROFILE AS NgNhan
		WHERE  dbo.NOTIFY.IDPost IN(SELECT dbo.PEOPLE_FOLLOW_POST.IDPost
										FROM dbo.PEOPLE_FOLLOW_POST
										where dbo.PEOPLE_FOLLOW_POST.IDuser = @IDuser)
			   AND @IDuser != dbo.NOTIFY.IDuserSend
			   AND Nggui.UIDuser = dbo.NOTIFY.IDuserSend
			   AND dbo.POST.IDPOST = dbo.NOTIFY.IDPost
			   AND dbo.POST.IDUSER = NgNhan.UIDuser
		ORDER BY dbo.NOTIFY.Time DESC
	END

GO
