CREATE PROC [dbo].[GetIdMessbox]
	@IdUser1 VARCHAR(30),
	@IdUser2 VARCHAR(30)
AS 
	BEGIN
	SELECT IDmessengerbox FROM dbo.MessengerBox WHERE (IDuser1 = @IdUser1 AND IDuser2 = @IdUser2) OR (IDuser1 = @IdUser2 AND IDuser2 = @IdUser1)
    END
