CREATE PROC [dbo].[GetMessfromIDMess]
	@IDmess varchar(30)
AS
BEGIN
	SELECT  IDmessenger,IDmessengerbox,Content,TIME, UIDuser
	FROM dbo.MESSENGER , dbo.PROFILE 
	WHERE IDmessenger = @IDmess AND UIDsend = dbo.PROFILE.UIDuser
	ORDER BY TIME DESC
END
