CREATE PROC [dbo].[GetOnlyOneNotify]
	@IDNotify varchar(30)
AS
	BEGIN
		SELECT dbo.NOTIFY.IDnotify, dbo.NOTIFY.IDPost , Nggui.NAME, NgNhan.NAME , NgNhan.UIDuser , dbo.NOTIFY.TypeNotify
		FROM dbo.NOTIFY, dbo.PROFILE AS Nggui, dbo.POST, dbo.PROFILE AS NgNhan
		WHERE  dbo.NOTIFY.IDnotify = @IDNotify
				AND dbo.NOTIFY.IDuserSend = Nggui.UIDuser
				AND dbo.NOTIFY.IDPost = dbo.POST.IDPOST
				AND dbo.POST.IDUSER = NgNhan.UIDuser

	END
