 CREATE PROC [dbo].[SignIn]
	@UserId VARCHAR(30),
	@PassWord VARCHAR(30)
AS
	BEGIN
 SELECT Profile.*
                FROM dbo.ACCOUNT AS acc, dbo.PROFILE AS Profile 
                WHERE acc.ID = @UserId AND acc.PASS = @PassWord AND Profile.UIDuser = acc.UID
	End
